--  DDL for Table DOMIBUS_CONNECTOR_ACTION
--------------------------------------------------------

  CREATE TABLE DOMIBUS_CONNECTOR_ACTION
   (	ACTION VARCHAR2(50) NOT NULL, 
	PDF_REQUIRED NUMBER(1,0) 
   ) ;
--------------------------------------------------------
--  DDL for Table DOMIBUS_CONNECTOR_EVIDENCES
--------------------------------------------------------

  CREATE TABLE "DOMIBUS_CONNECTOR_EVIDENCES" 
   (	"ID" NUMBER(10,0), 
	"MESSAGE_ID" NUMBER(10,0), 
	"TYPE" VARCHAR2(255), 
	"EVIDENCE" CLOB, 
	"DELIVERED_NAT" TIMESTAMP (6), 
	"DELIVERED_GW" TIMESTAMP (6), 
	"UPDATED" TIMESTAMP (6)
   ) ;
--------------------------------------------------------
--  DDL for Table DOMIBUS_CONNECTOR_MESSAGE_INFO
--------------------------------------------------------

  CREATE TABLE "DOMIBUS_CONNECTOR_MESSAGE_INFO" 
   (	"ID" NUMBER(10,0), 
	"MESSAGE_ID" NUMBER(10,0), 
	"FROM_PARTY_ID" VARCHAR2(255), 
	"FROM_PARTY_ROLE" VARCHAR2(255), 
	"TO_PARTY_ID" VARCHAR2(255), 
	"TO_PARTY_ROLE" VARCHAR2(255), 
	"ORIGINAL_SENDER" VARCHAR2(255), 
	"FINAL_RECIPIENT" VARCHAR2(255), 
	"SERVICE" VARCHAR2(255), 
	"ACTION" VARCHAR2(255), 
	"CREATED" TIMESTAMP (6), 
	"UPDATED" TIMESTAMP (6)
   ) ;
--------------------------------------------------------
--  DDL for Table DOMIBUS_CONNECTOR_MESSAGES
--------------------------------------------------------

  CREATE TABLE "DOMIBUS_CONNECTOR_MESSAGES" 
   (	"ID" NUMBER(10,0), 
	"EBMS_MESSAGE_ID" VARCHAR2(255), 
	"NAT_MESSAGE_ID" VARCHAR2(255), 
	"CONVERSATION_ID" VARCHAR2(255), 
	"DIRECTION" VARCHAR2(10), 
	"HASH_VALUE" VARCHAR2(1000), 
	"CONFIRMED" TIMESTAMP (6), 
	"REJECTED" TIMESTAMP (6), 
	"DELIVERED_NAT" TIMESTAMP (6), 
	"DELIVERED_GW" TIMESTAMP (6), 
	"UPDATED" TIMESTAMP (6)
   ) ;
--------------------------------------------------------
--  DDL for Table DOMIBUS_CONNECTOR_MSG_ERROR
--------------------------------------------------------

  CREATE TABLE "DOMIBUS_CONNECTOR_MSG_ERROR" 
   (	"ID" NUMBER(10,0), 
	"MESSAGE_ID" NUMBER(10,0), 
	"ERROR_MESSAGE" VARCHAR2(255), 
	"DETAILED_TEXT" CLOB, 
	"ERROR_SOURCE" VARCHAR2(255), 
	"CREATED" TIMESTAMP (6)
   ) ;
--------------------------------------------------------
--  DDL for Table DOMIBUS_CONNECTOR_PARTY
--------------------------------------------------------

  CREATE TABLE "DOMIBUS_CONNECTOR_PARTY" 
   (	"PARTY_ID" VARCHAR2(50), 
	"ROLE" VARCHAR2(255), 
